function testBrowser(){var a=navigator.userAgent.toLowerCase();if(/msie/i.test(a)&&!/opera/.test(a)){return"IE"}else{if(/firefox/i.test(a)){return"Firefox"}else{if(/chrome/i.test(a)&&/webkit/i.test(a)&&/mozilla/i.test(a)){return"Chrome"}else{if(/opera/i.test(a)){return"Opera"}else{if(/webkit/i.test(a)&&!(/chrome/i.test(a)&&/webkit/i.test(a)&&/mozilla/i.test(a))){return"Safari"}else{return"unKnow"}}}}}};